    "2013-03-15T12:03:05.079831",nt"name": "observation-points-for-hubbell-trading-post-national-historic-site-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "The data collection for Hubbell Trading
    Post used an "Observation Point" form which is identical to the data collection
    protocols descibed by the USGS-NPS accuracy assessment protocols of larger parks.
    This data form collects enough data to assign an existing vegetation association
    to that point. Prior to the field visit all interpreted vegetation polygons were
    assigned a numeric ID. The field crew visited the majority of polygons. Both polygons
    within the Park boundary and in the surrounding environs were visited. For each
    observation point, field photographs were recorded in several directions. Not all
    polygons received a visit. The crew concentrated their time on the largest and ecologically
    more interesting polygons.",nt"license_title": null,nt"extras": [{ntt"key":
